    "pathfinder-national-wildlife-refuge-narrative-report-may-june-july-august-1960",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Pathfinder National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1960.
    The report begins by summarizing the weather conditions, water conditions, habitat
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, and reptiles- is also covered. The Refuge development and maintenance section
    discusses physical developments and wildfires.  A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses. Items of interest, photographs, and N-R forms are attached.",nt"license_title":
